import React, { useState, useEffect } from 'react';
import { Helmet } from 'react-helmet';
import { useLocation } from 'react-router-dom';
import { Button, Input, Heading } from "../../components";
import Header from "../../components/Header";
import axios from 'axios';

const EditarUsuario = () => {
    const [userData, setUserData] = useState({
        nome: '',
        nome_de_usuario: '',
        cargo: '',
        cpf: '',
        rg: '',
        senha: ''
    });
    const location = useLocation();
    const params = new URLSearchParams(location.search);
    const cpf = params.get('cpf');

    useEffect(() => {
        const fetchUser = async () => {
            const token = localStorage.getItem('token');
            try {
                const response = await axios.get(`http://localhost:3010/usuario?cpf=${cpf}`, {
                    headers: {
                        Authorization: `Bearer ${token}`
                    }
                });
                setUserData(response.data);
            } catch (error) {
                console.error('Erro ao buscar usuário:', error);
            }
        };

        if (cpf) {
            fetchUser();
        }
    }, [cpf]);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setUserData(prevState => ({ ...prevState, [name]: value }));
    };

    const handleSubmit = async () => {
        const token = localStorage.getItem('token');
        try {
            await axios.put(`http://localhost:3010/usuario?cpf=${cpf}`, userData, {
                headers: {
                    Authorization: `Bearer ${token}`
                }
            });
            alert('Usuário atualizado com sucesso!');
        } catch (error) {
            console.error('Erro ao atualizar usuário:', error);
        }
    };

    return (
        <>
            <Helmet>
                <title>Editar Usuário</title>
                <meta name="description" content="Página de edição de usuário" />
            </Helmet>
            <div className="flex w-full flex-col items-start bg-gray-300 py-11 md:py-5">
                <div className="container-xs mb-1 flex flex-col gap-[54px] md:p-5 sm:gap-[27px]">
                    <Header />
                    <div className="mx-[186px] flex flex-col items-end gap-[110px] md:mx-0 md:gap-[82px] sm:gap-[55px]">
                        <div className="flex w-[90%] justify-end md:w-full">
                            <div className="flex w-full flex-col items-center gap-[38px]">
                                <Heading size="textlg" as="h1" className="uppercase">
                                    Editar Usuário
                                </Heading>
                                <div className="flex items-center self-stretch md:flex-col">
                                    <div className="flex w-full flex-col items-start gap-[30px]">
                                        <div className="flex w-[90%] flex-col items-center gap-0.5 md:w-full">
                                            <Heading as="h2">Nome Completo</Heading>
                                            <Input shape="round" name="nome" value={userData.nome} onChange={handleChange} className="self-stretch sm:pr-5" />
                                        </div>
                                        <div className="flex w-[90%] flex-col items-center md:w-full">
                                            <Heading as="h3">Nome de Usuário</Heading>
                                            <Input shape="round" name="nome_de_usuario" value={userData.nome_de_usuario} onChange={handleChange} className="self-stretch sm:pr-5" />
                                        </div>
                                        <div className="flex w-[90%] flex-col items-center md:w-full">
                                            <Heading as="h4" className="relative z-[1]">Cargo</Heading>
                                            <Input shape="round" name="cargo" value={userData.cargo} onChange={handleChange} className="self-stretch sm:pr-5" />
                                        </div>
                                        <div className="flex w-[90%] flex-col items-center md:w-full">
                                            <Heading as="h5">CPF</Heading>
                                            <Input shape="round" name="cpf" value={userData.cpf} onChange={handleChange} className="self-stretch sm:pr-5" readOnly />
                                        </div>
                                        <div className="flex w-[90%] flex-col items-center md:w-full">
                                            <Heading as="h6">RG</Heading>
                                            <Input shape="round" name="rg" value={userData.rg} onChange={handleChange} className="self-stretch sm:pr-5" />
                                        </div>
                                        <div className="flex w-[90%] flex-col items-center md:w-full">
                                            <Heading as="h6">Senha</Heading>
                                            <Input shape="round" name="senha" type="password" value={userData.senha} onChange={handleChange} className="self-stretch sm:pr-5" />
                                        </div>
                                    </div>
                                    <Button shape="round" className="mt-4" onClick={handleSubmit}>
                                        Salvar
                                    </Button>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    );
};

export default EditarUsuario;
